INSERT INTO `version_update_log` VALUES ('测试多个感谢商家', '信息时报综合报道 12日，日本外务大臣岸田文雄与韩国外交部长尹炳世举行电话会谈，日方确认将出资10亿日元（约合987万美元）作为韩国“慰安妇”受害者“治愈金”。韩国外交部当天表示，两国外长在会谈中重申，应通过切实履行“慰安妇”协议，尽早恢复“慰安妇”受害者名誉和尊严，并治愈其心理创伤。\n\n\n　　2015年12月28日，日韩外长就解决“慰安妇”问题达成一致。岸田文雄承认日本政府在“慰安妇”问题上负有责任，向“慰安妇”受害者“表示诚挚道歉和反省”。 双方商定，将由韩方发起成立“慰安妇”受害者援助基金，日方将利用财政预算向该基金提供10亿日元资金。韩方当时表示，若日方能切实履行承诺，韩方将确认“慰安妇”问题不可逆地终结。\n\n　　但对于这样的“和解与治愈”，“慰安妇”受害者和遗属并 不买账。他们认为，日军强征“慰安妇”是绝对不能忘却的历史，是仍在进行中的历史相关人权问题，是日本的战争罪行。日本作为加害国，回避公开谢罪和法律赔 偿。作为遗属代表，“慰安妇”受害者崔善顺的儿子表示，如今回想起母亲的一生仍然会心痛不已。谈及日方10亿日元款项，他表示，钱不是问题，重点是谈钱这 件事本身就让一切变得没有诚意。\n\n　　“没有公开谢罪和法律赔偿，这样的钱再多我们也不要！”“慰安妇”受害者金福童在8月10日的示威集会上愤怒地说。金福童说，“慰安妇”少女铜像由韩国民众亲自设立，是期盼和平的象征，日本无权要求韩国将其拆除。', '泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击泰警方继续缉拿连环爆炸案嫌犯 旅游业或受冲击', null, '2016-08-15 11:58:32', null, '2016-08-15 11:58:32');
